import React, { Component } from 'react';
import ArticleDataService from '../service/ArticleDataService';
import LineComponent from './LineComponent';

class ArticleComponent extends Component {

    constructor(props) {
        super(props)
        this.state = {
            article: null,
            message: null
        }
        this.refreshArticle = this.refreshArticle.bind(this)
    }

    componentDidMount() {
        this.refreshArticle();
    }

    refreshArticle() {
        ArticleDataService.retrieveArticleByTitle("Greatest Bird Picture Ever")
            .then(
                response => {
                    console.log(response);
                    this.setState({article: response.data})
                }
            )
    }

    render() {
        return (
            <>

                <LineComponent/>
                <h1>Title of Article</h1>

                <div class="row">
                    <div class="col-md-2" style={{borderRight: '1px solid red'}}>
                        <h6>this.state.article.title</h6>
                    </div>

                    {/* this.state.articles.map(
                                    article =>
                                    <tr key={article.id}>
                                        <td>{article.id}</td>
                                        <td>{article.author}</td>
                                        <td>{article.text}</td>
                                    </tr>
                                ) */}

                    <div class="col-md-2" style={{borderRight: '1px solid red'}}>
                        <h6>December 13th, 2019</h6>
                    </div>
                    <div class="col-md-2" >
                        <h6>honey dew</h6>
                    </div>
                    <div class="col-md-6"></div>
                </div>

                <LineComponent/>

                <div class="container">
                    <div class="row">
                        <div class="span4"></div>
                            <div class="span4"><img class="center-block img-fluid" src={require('../images/articleImages/birdsEattingSeeds.jpg')}  /></div>
                        <div class="span4"></div>
                    </div>
                </div>

                <div className="container">
                    <p class="text-muted">Picture of bird by Arlee Christian.</p>
                </div>

                <LineComponent/>

                <div className="container">
                    <p>Arlee took this picture of a bird in 1994.</p>
                </div>

                <LineComponent/>

            </>
        )
    }
}

export default ArticleComponent
